import './App.css';
import Nav from './component/Nav';
import {BrowserRouter,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
     <BrowserRouter>
       <Routes>
        <Route path="/" element={<Nav/>}/>
        <Route></Route>
       </Routes>
     </BrowserRouter>

     <h1>E-Dashboard</h1>
    </div>
  );
}

export default App;
